import React from 'react'
import ExpenseItem from './ExpenseItem'

// @ts-ignore
const ExpensesList = (props) => {
  let expensesList = <p>No results found</p>
  if (props.listTotal > 0) {
    expensesList = props.filterdList.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ))
    return expensesList
  }
}

export default ExpensesList
